import {
    BrowserRouter,
    Route,
    Routes
} from "react-router-dom";
import Home from "./pages/frontend/Home";
import AllProducts from "./pages/frontend/AllProducts";
import Card from "./pages/frontend/Card";
import Contact from "./pages/frontend/Contact";
import NotFound from "./pages/frontend/NotFound";



function App() {
    return ( <
        BrowserRouter >
        <
        Routes >
        <
        Route >

        <
        Route index element = {
            < Home / >
        } > < /Route> <
        Route path = "/allproducts"
        element = {
            < AllProducts / >
        } > < /Route> <
        Route path = "/card"
        element = {
            < Card / >
        } > < /Route> <
        Route path = "/contact"
        element = {
            < Contact / >
        } > < /Route> <
        Route path = "*"
        element = {
            < NotFound / >
        } > < /Route>

        <
        /Route>

        <
        /Routes>

        <
        /BrowserRouter>
    );
}

export default App;
